import React, {Component} from "react";
import Navbar from './Navbar'; 

class App extends Component{

    render(){
        return( 
            <div>
                <Navbar/>
            <div>
            <h>Hello, World!</h>
            
            </div>
            </div>
        )
    }
}
export default App;
